import React from 'react';
import logo from './logo.svg';
import './App.css';

const elements = React.createElement(
  'div',
  { className: 'App-without-jsx' },
  React.createElement(
    'header',
    { className: 'App-header' },
    React.createElement(
      'img',
      { className: 'App-logo', src: logo, alt: 'Logo-no-jsx' }
    )
  )
);

function App() {
  return elements;
